import React from "react";
import "./Form.css";
export default class Progressbar extends React.Component {
  constructor(props) {
    super(props);
  }
  ChangePassword = () => {};
  render() {
    return (
      <>
        <div className="progress">
          <div
            className="progress-bar"
            style={{ width: "70%", background: "red" }}
          ></div>
        </div>
      </>
    );
  }
}
